import { Outlet, Link } from "react-router-dom";
import styled from "styled-components";

// Define styled components for your styling
const StyledLandingPage = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 20px;

  header {
    text-align: center;
    padding: 20px 0;
  }

  h1 {
    font-size: 2em;
    color: #333;
  }

  nav ul {
    list-style-type: none;
    padding: 0;
  }

  nav ul li {
    display: inline;
    margin-right: 20px;
  }

  nav ul li a {
    text-decoration: none;
    color: #333;
    font-weight: bold;
  }
`;

const LandingPage = () => {
  return (
    <StyledLandingPage>
      <header>
        <h1>SeniorSync</h1>
      </header>
      <nav>
        <ul>
          <li>
            <Link to="/metrics">Metrics</Link>
          </li>
        </ul>
      </nav>
      <Outlet />
    </StyledLandingPage>
  );
};

export default LandingPage;
